import React from "react";
import {
  BrowserRouter as Router,
  Route,
  Redirect,
  Switch,
  Routes
} from 'react-router-dom';

import ArticleMangement from "./ArticleMangement";
import App from "../App";


function Navbar() {
  let routes;

  routes=(
  <Routes>
    <Route path="/Article" element={<ArticleMangement />} />
    <Route path="/" element={<App />} />
  </Routes>
  );
  return (
    <nav>
      <h2>Blog System</h2>
      <div className="nav-right">
        <button>Login</button>
        <main>{routes}</main>
      </div>
    </nav>
  );
}

export default Navbar;
